- input: TEXT,F3A,,"Per your letter, there may be a contribution over $1000.00 for
    which there was no 48 hour notice. I have checked all cash contributions and they
    appear to be all properly reported. There was an in-kind contribution from the
    NRA Political Victory Fund of $2298.83 for which I did not file a 48 hour notice.
    This was a mailer done by the NRA. We were not notified by the NRA of the contribution
    and the amount until after the primary election. Your letter also indicates there
    were incomplete identification disclosures for individuals who contributed over
    $200. I cannot find any problems with any contributions listed in my 30 day Post-General
    report. Do you have a specific page number or contributor name I can use to trace
    this?"
